import logo from '../logo.jpeg'

function Welcome() {
  return (
    <div className='welcome-container'>
      <img src={logo} alt="logo" className='welcome-logo'/>
      <p>View and text people in the chat rooms.</p>
    </div>
  )
}

export default Welcome
